import {REGISTER_FORM} from "../types";

const defaultState = {
    label: 5
};

export const registerFormReducer = (state = defaultState, action) => {
    if (action.type === REGISTER_FORM){
        console.log(`payload = ${action.payload}`);
        return {
            ...state, label: state.label + action.payload
        }
    }else return state;
};
